text:
@Embrace The Red didn't expect a rely to a 2 month old video, lol. I do want to state that your video is amazing and I was not aware of the complexities with ChatGPT.

My comment was not really meant as anything serious, it was more just poking fun that when you're referring to tables, or columns (at least in this video) that you don't use any any ` when referencing a column. When learning MySQL (specifically MariaDB's version of it) and php (specifically PDO which is the most popular and secure way to interact with a mysql server) I was always taught to use the tilde key to properly refer to a column. An example of what i'm referring to is:

SELECT `firstname` FROM `users` WHERE `id` = 1;

instead in your video the way you would of wrote it was:

SELECT firstname FROM users WHERE id = 1;

In PHP, you're very likely to run into issues with the second way it was done as it may give a syntax error, or believe you're attempting to refer to a RESERVED word if not properly referring to your column. While obviously I believe that directly engaging with the mysql server would not give you an issue with the way you were doing it, in php you would very likely run into issues. 

Again my comment wasn't meant to be taken serious, excellent video, it was just a form of PTSD I got when I noticed there were no tilde keys in reference.

@Embrace The Red You'd be surprised how easy it is to find it out - just ask ChatGPT about GPT :) - But yes, the full prompt is not sent from the browser, since the browser just connects to a backend. I suppose, the backend keeps track of the history and compiles the prompt. I was able to reproduce this with the OpenAI-API, and it works just fine. You even don't need a certain format for the history, keep in mind, GPT is intelligent. So it can figure out history formats itself when provided with an example, I'm using an xml-like history in my experiments. So I have some AI-persona now, a grumpy "Norbert", a cheerful "Lili", and a depressed "Marvin", all with history (and obviously some character priming). And since my history contains a kind of timestamp, you can ask questions like "what did we talk about three minutes ago?".

Also I'm rather sure, that ChatGPT is "fine tuned", means, received additional training. And for sure there is a moderation AI involved.

My advice: Use the API, you can do so much more there :)
